css:
@-moz-document domain("websdr.ewi.utwente.nl"), domain("websdr.org") {
/* Theme: Skyking Dark
 * For: websdr.ewi.utwente.nl:8901 & websdr.ewi.utwente.nl/org/ (websdr.org)
 * Modified by: Desu
 * Based on: 2E0PGS, https://bitbucket.org/2E0PGS/userstyles/overview
 * Mascot: Formation Girls */
body,
.mainspan,
.maincontrols,
.tab,
.ctl {
    color: rgba(255, 255, 255, .6);
    font-family: monospace;
}
.mainspan,
.maincontrols,
.tab,
.ctl {
    background: transparent!important;
}
body {
    width: 1075px!important;
    padding: 0;
    font-size: 10pt;
}
a {
    color: rgb(117, 164, 224)!important;
}

/*three links on top*/
body > a > div.othsce1 {
    display: none;
}
body > a[href="/wspr/"],
body > a[href="/chirps/"],
body > a[href="/fullday/"] {
    background: #050505;
    border-radius: .3em;
    border: 1px solid #444;
    display: block!important;
    float: left;
    width: auto;
    padding: .5em;
    margin: .5em .5em .5em 0;
    text-align: center;
}
body > a[href="/wspr/"]:after {
    content: "WSPR receptiontest";
}
body > a[href="/chirps/"]:after {
    content: "Chirp Signal reception";
}
body > a[href="/fullday/"]:after {
    content: "Entire day waterfall display";
}
div[style="color: red"] {
    color: #91ffd1!important;
}

/*reduce the title size and change to text*/

/*there are no selectors...*/
body > table > tbody > tr > td {
    vertical-align: top;
}
body > table > tbody > tr > td[width="300px"] > a[href="http://www.ewi.utwente.nl"] font,
body > table > tbody > tr > td[width="230px"] > a[href="http://www.etgd.utwente.nl"] font,
body > table > tbody > tr > td[colspan="3"] > center > font {
    font-family: monospace;
    font-size: 8pt;
}
body > table > tbody > tr > td[colspan="3"] > center {
    text-align: left!important;
}
body > table > tbody > tr > td[rowspan="2"] > a[href="http://www.veron.nl"]:after {
    content: "VERNON";
    font-size: 8pt;
}
body > table > tbody > tr > td[rowspan="2"] > a[href="http://www.veron.nl"] img[alt="VERON"] {
    display: none;
}

/*university name*/
body > table > tbody > tr > td[rowspan="2"] > a[href="http://www.utwente.nl"]:after {
    content: "University of Twente, Enschede - The Netherlands";
    font-size: 8pt;
}
body > table > tbody > tr > td[rowspan="2"] > a[href="http://www.utwente.nl"] img {
    display: none;
}

/*other*/
hr {
    opacity: 0;
}
img[alt="[picture of the SDR hardware]"] {
    width: 25%!important;
}
.othsce1:hover {
    opacity: 1;
}
font[color="red"] {
    color: #fff;
}
select {
    border: 1px solid rgba(255, 255, 255, .3);
    color: rgba(255, 255, 255, .8);
    background-color: rgba(0, 0, 0, .7);
}
input[type="text"] {
    border: 1px solid rgba(255, 255, 255, .3);
    color: rgba(255, 255, 255, .8);
    background-color: rgba(0, 0, 0, .7);
    font-family: monospace!important;
    font-size: 1em;
    padding: .25em;
}
input[type="button"],
button {
    border: 1px solid rgba(255, 255, 255, .3);
    color: rgba(255, 255, 255, .8);
    background-color: rgba(0, 0, 0, .7);
    cursor: pointer;
    border-radius: .2em;
}
form[name="chatform"] input[name="chat"] {
    padding: .5em;
    margin: .5em 0;
}
#please {
    font-family: monospace!important;
    background: rgba(255, 255, 255, .05);
    display: block;
    padding: .5em;
    border: 1px solid rgba(255, 255, 255, .2);
}
#html5choice span {
    color: rgba(255, 255, 255, .6)!important;
}

/*tabs*/
div.tab {
    border: 1px solid rgba(255, 255, 255, .1);
}
div.tabs [type=radio]:checked + label {
    background: #3e3e3e;
}
div.tabs label:hover {
    background: #5f5d5d;
}
div.tabs label {
    background: #252525;
    cursor: pointer;
}

/*controls*/
button[style="background: rgb(170, 170, 170);"],
button[style="background: rgb(170, 170, 170) none repeat scroll 0% 0%;"] {
    background: #8e2c2c!important;
}

/*tab labels*/
div.mainspan div.tabs > label {
    font-family: monospace;
}

/*change chat tab highlight to a darker color... there are no identifiers other than an inline style triggered by javascript... can't be helped desu*/
div.mainspan div.tabs > label[style="background: rgb(204, 255, 255) none repeat scroll 0% 0%;"],
div.mainspan div.tabs > label[style="background: rgb(204, 255, 255);"] {
    background: #8e2c2c!important;
}

/*tab content*/
#memories table {
    color: rgba(0, 0, 0, .8);
}
#memories table .membutton {
    height: auto;
    line-height: 1.2em;
}
#chatbox {
    background-color: rgba(0, 0, 0, 1)!important;
    color: rgba(255, 255, 255, .5)!important;
    margin-top: 1em;
}

/*logbook*/
div.tabs div.tab:nth-of-type(5) iframe {
    border: 1px solid rgba(0, 0, 0, .5);
    background: rgba(255, 255, 255, .2);
    overflow-x: hidden!important;
}
body > pre {
    background: rgba(25, 25, 25, .7);
    display: block;
    height: 100%;
    margin: 0;
    font-size: 12px;
}

/*bottom*/
#soundappletdiv > div {
    background: rgba(0, 0, 0, .5)!important;
}

/*websdr.org list page*/
#status table thead.onerx,
#status table td.separation {
    background-color: #000;
}
#status table tbody.onerx {
    background-color: transparent;
}
.onerxmarker {
    background-color: rgba(255, 255, 255, .1);
}
.m00,
.m0,
.m1,
.muhf,
.g10,
.m70,
.m2,
.m6,
.m10,
.m12,
.m15,
.m17,
.m20,
.m30,
.m40,
.m80,
.m160,
.mlf {
    color: #111;
}

/*mascot
 *this is a base64 encoded image
 *use base64-image.de to convert your own mascot
 */
body {
    background: #151517 url('data:image/png;base64,') right top no-repeat fixed;
}
}
